import './App.css';
import Intro from './Intro';
import Brands from './Brands.js'

import './App.css';
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

import firstModel from '../images/first-model.png'
import secondtModel from '../images/second-model.png'
import thirdModel from '../images/third-model.png'

function App() {
  return (
    <Router>
      <Intro></Intro>
      <Brands></Brands>
      <div id='new-arrivals'>
        <img src={firstModel}></img>
        <img src=""></img>
        <img src=""></img>

      </div>
      <Routes>
        <Route path="/catalog" element={<h2>Catalog Page</h2>} />
      </Routes>
    </Router>

  );
}

export default App;
